import React, { Component } from 'react';
import 'whatwg-fetch';
import './css/stylesheet.css';
import ReactDOM from 'react-dom'
import { Route, Link, BrowserRouter as Router } from 'react-router-dom'


class Welcome extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isLoading: true,
      token: 0,
      username: 'User',
      password: '',
      email: '',
      fullName: 'First Lame',
      message: ''
    };


  }

  componentDidMount() {
      this.setState({
        isLoading: false,
      });
  }

  onChange = e => {
    this.setState({ [e.target.id]: e.target.value });
  };


  render() {
    const {
      isLoading,
      token,
      username,
      password,
      email,
      fullName,
      message
    } = this.state;

    if (isLoading) {
      return (<div><p>Loading...</p></div>);
    }

    if (!token) {
      return (
        <div>
        	<h1>Welcome!</h1>
        </div>
      );
    }
  }
}

export default Welcome;
